import React from "react";
import NavBar from "../../Components/Navigation/NavBar";

export default function Home(){
    return(
        <React.Fragment>
            <NavBar/>
            <img src='../../Images/Reynolds_pens_logo.png' className='reynold-logo' alt='logo'/>
            <h1>Pasindu</h1>
        </React.Fragment>
    );
}
